function Item(props) {
    function check() {
        if (props.id != null && props.id == "active") {
            return (
                <li id="active">
                    <i className={props.c}></i>
                    <a href={props.link}>{props.value}</a>
                </li>
            );
        } else {
            return (
                <li>
                    <i className={props.c}></i>
                    <a href={props.link}>{props.value}</a>
                </li>
            );
        }
    }
    return check();
}

export default Item;
